equity.fundamental.management.description:
Learn about key executives for a company and how to retrieve their data
  using the `obb.equity.fundamental.management` function. Get details such as designation,
  name, pay, currency, gender, birth year, and title since.

equity.price.quote.description:
Learn how to load stock data for a specific ticker with the Equity Quote
  function. Discover the various parameters and data returned, including day low,
  day high, date, symbol, name, price, volume, and more.

index.snapshots.description:
Index Snapshots documentation page with information on current levels
  for all indices from a specific provider, and details on parameters, query, returns,
  and data.

regulators.sec.cik_map.description:
Learn how to retrieve the CIK number corresponding to a ticker symbol
  using the python obb.regulators.sec.cik_map function. Understand the available parameters,
  return values, and data structure.

technical.cones.description:
Calculate realized volatility quantiles over rolling windows of time
  using different volatility models. Understand the parameters and their effects,
  such as index, quantile values, and is_crypto. Examples and code snippets provided.
